import resume from "../images/Resume_Latest.pdf";
import FileViewer from "react-file-viewer";
import React from 'react';
import Iframe from 'react-iframe';

export default function ProjectsPage() {
    return (
        <Iframe url="../images/Resume_Latest.pdf"
                src={resume}
                id="myId"
                width="900px"
                height="950px"
                className="myClassname"
                display="initial"
                position="relative"/>
    );
}
